import axios from "axios";
import React, { useContext, useEffect, useState } from "react";
import { AuthContext } from "../../../../auth/AuthContext";
import { types } from "../../../../types/Types";

export const HomeAdmin = () => {
    const [userFoto, setUserFoto] = useState("");
    const [username, setUsername] = useState("");
    const [userFullName, setUserFullName] = useState("");
    const [listLastClientes, setListLastClientes] = useState([]);
    const [listLastPagos, setListLastPagos] = useState([]);

    const handleEditar = async (e) => {};

    const {
        userLogged: { user, name, path },
        dispatch,
    } = useContext(AuthContext);

    useEffect(() => {
        axios.get(types.apiurl + "/home/clientes").then((resp) => {
            setListLastClientes(resp.data);
        });
    }, []);

    useEffect(() => {
        axios.get(types.apiurl + "/home/pagos").then((resp) => {
            setListLastPagos(resp.data);
        });
    }, []);

    return (
        <div className="container mt-5 pb-5">
            <h1>Ultimos agregados</h1>
            <hr />
            <br />
            <br />
            <form autoComplete="off">
                <div className="box">
                    <div>
                        <div className="form-group">
                            <h4>Nombre de los ultimos clientes agregados</h4>
                        </div>
                        <table className="table">
                            <thead>
                                <tr>
                                    <th>DPI</th>
                                    <th>Nombre</th>
                                    <th>Apellido</th>
                                    <th>Teléfono</th>
                                    <th>Email</th>
                                    <th>Dirección</th>
                                </tr>
                            </thead>
                            <tbody>
                                {listLastClientes.map((lstClientes) => (
                                    <tr>
                                        <td>{lstClientes.DPI}</td>
                                        <td>{lstClientes.Nombre}</td>
                                        <td>{lstClientes.Apellido}</td>
                                        <td>{lstClientes.Telefono}</td>
                                        <td>{lstClientes.Email}</td>
                                        <td>{lstClientes.Direccion}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </form>
            <br />
            <br />

            <hr />
            <form autoComplete="off">
                <div className="box">
                    <div>
                        <div className="form-group">
                            <h4>Pagos proximos a vencer</h4>
                        </div>
                        <table className="table">
                            <thead>
                                <tr>
                                    <th>ID Prestamo</th>
                                    <th>DPI</th>
                                    <th>Nombre</th>
                                    <th>Apellido</th>
                                    {/*<th>Fecha de pago</th>*/}
                                    <th>Monto Q</th>
                                    <th>Saldo Q</th>
                                </tr>
                            </thead>
                            <tbody>
                                {listLastPagos.map((lstClientes) => (
                                    <tr>
                                        <td>{lstClientes.idPrestamo}</td>
                                        <td>{lstClientes.DPI}</td>
                                        <td>{lstClientes.Nombre}</td>
                                        <td>{lstClientes.Apellido}</td>
                                        {/*<td>{lstClientes.Fecha_inicio}</td>*/}
                                        <td>{lstClientes.Cantidad_neta}</td>
                                        <td>{lstClientes.Monto_cancelado_c}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </form>
            <br />
            <br />
        </div>
    );
};
